                "minutesDuration": 15,
                "comment": "Hello,\n\nDue to the current COVID numbers and our commitment to keep our patients, their families, and our staff safe, we have temporarily changed our visitor policy.\n\nAll patients and care staff must wear a mask covering their mouth and nose and will be asked screening questions regardless of vaccination status.\nWe are asking that all care companions wait in the car unless clinical assistance is required.\nFor those under going a procedure or surgery, our care team will provide timely updates, as well as instructions for when the care companion can enter the clinic.\nMinor patients (under 18 years old) may be accompanied by one parent/guardian.\nFor Pediatrics, one care companion along with only those children who are seeing a provider that day will be permitted in the clinic.\nPost-partum patients may bring their newborn to their visit.\n\nPlease call our office prior to your visit if you have recently tested positive for COVID, have been exposed to someone with COVID or have COVID symptoms.\nWe appreciate your understanding and look forward to caring for you,\n\nDuly Health and Care\n",
