                "note": [
                    {
                        "text": "A mutation in KRAS codon 12 was detected: c.35G>T, p.G12V \r\n\r\nThis result has been reviewed and approved by Allie Grossmann, \r\nMD., PhD.\r\nINTERPRETIVE INFORMATION: KRAS Mutation Detection\r\n\r\nOncogenic KRAS mutations have been linked with resistance to \r\nanti-EGFR therapies.  Thus, determination of mutation status is \r\nuseful in determining patient eligibility for this treatment.  \r\n\r\nMethodology: DNA is isolated from microdissected tumor tissue and \r\namplified for segments of the KRAS gene covering codons 12, 13, \r\nand 61.  Mutation status for these three codons is determined by \r\npyrosequencing.   \r\nLimitations: Mutations in other locations within the KRAS gene or \r\nin other genes will not be detected.  \r\nLimit of detection: 10 percent mutant alleles.\r\n\r\nClinical Disclaimer: Results of this test must always be \r\ninterpreted within the clinical context and other relevant data, \r\nand should not be used alone for a diagnosis of malignancy. This \r\ntest is not intended to detect minimal residual disease.\r\n\r\nThis test was developed and its performance characteristics \r\ndetermined by ARUP Laboratories. It has not been cleared or \r\napproved by the US Food and Drug Administration. This test was \r\nperformed in a CLIA certified laboratory and is intended for \r\nclinical purposes."
