                "note": [
                    {
                        "text": "\r\nNo EGFR mutation was detected. This result does not rule out the \r\npossibility of a mutation below the detectable limit of the assay.\r\n \r\nThis result has been reviewed and approved by Joshua F. Coleman, \r\nM.D.\r\nTEST INFORMATION: EGFR Mutation Detection by Pyrosequencing\r\n \r\nDetermining EGFR mutation status is useful in identifying patient \r\neligibility for tyrosine kinase inhibitor (TKI) therapy. Specific \r\noncogenic EGFR mutations in pulmonary adenocarcinomas are \r\nassociated with clinical response or resistance to certain TKIs.\r\n \r\nMethodology:  DNA is isolated from microdissected tumor tissue and \r\namplified for segments of the EGFR gene covering codons 719, \r\n745-753, 768, 790, 858, and 861.  Mutation status for these codons \r\nis determined by pyrosequencing.  \r\n \r\nLimitations:  Mutations in other locations within the EGFR gene or \r\nin other genes will not be detected.\r\n \r\nLimit of Detection:  10 percent mutant alleles.  \r\n \r\nClinical Disclaimer: Results of this test must always be \r\ninterpreted within the clinical context and other relevant data, \r\nand should not be used alone for the diagnosis of malignancy.  \r\nThis test is not intended to detect minimal residual disease.\r\n\r\nThis test was developed and its performance characteristics \r\ndetermined by ARUP Laboratories. It has not been cleared or \r\napproved by the US Food and Drug Administration. This test was \r\nperformed in a CLIA certified laboratory and is intended for \r\nclinical purposes."
