                "valueString": "See Note",
                "note": [
                    {
                        "text": "ALKD5F3 immunohistochemistry stain is uninterpretable in this case \r\ndue to non-specific background. Repeat testing was attempted, but \r\nno tumor tissue was present on these slide levels for evaluation. \r\nTesting on another specimen if available should be considered\r\n\r\nThis result has been reviewed and approved by Joshua F. Coleman, \r\nM.D. Controls performed as expected.\r\nINTERPRETIVE INFORMATION: ALK(D5F3) by IHC Result\r\n\r\nA result of negative is defined by absence of cytoplasmic staining \r\nin tumor cells. A positive result is defined as the presence of \r\nstrong and diffuse, cytoplasmic staining in tumor cells.  An \r\nequivocal result is defined by weak and/or focal cytoplasmic \r\nstaining. ALK Gene Rearrangements by FISH may be useful for \r\nresolving an equivocal IHC result. Positive IHC results may \r\npredict response to ALK inhibitors. \r\n\r\nControls were run and performed as expected. \r\n\r\nThis assay is performed on formalin fixed paraffin embedded \r\ntissue, using the ALK D5F3 clone and a proprietary multimer based \r\ndetection system.\r\n\r\n\r\nThis test was developed and its performance characteristics \r\ndetermined by ARUP Laboratories. It has not been cleared or \r\napproved by the US Food and Drug Administration. This test was \r\nperformed in a CLIA certified laboratory and is intended for \r\nclinical purposes.\r\n\r\n\r\nReferences\r\n1. Lindeman NI., Cagle PT., Aisner DL., et al. Updated Molecular \r\nTesting Guideline for the Selection of Lung Cancer Patients for \r\nTreatment With Targeted Tyrosine Kinase Inhibitors. Guideline From \r\nthe College of American Pathologists, the International \r\nAssociation for the Study of Lung Cancer, and the Association for \r\nMolecular Pathology. J Mol Diagn 2018;20:129-59.\r\n2. Rogers T-M., Russel PA., Wright G., et al. Comparison of \r\nMethods in the Detection of ALK and ROS1 Rearrangements in Lung \r\nCancer. J Thorac Oncol 2015;10:6118.\r\n3. Wynes MW., Sholl LM., Dietel M., et al. An International \r\nInterpretation Study Using the ALK IHC Antibody D5F3 and a \r\nSensitive Detection Kit Demonstrates High Concordance between ALK \r\nIHC and ALK FISH and between Evaluators. J Thorac Oncol \r\n2014;9:6318.\r\n4. von Laffert M., Warth A., Penzel R., et al.  Multicenter \r\nImmunohistochemical ALK-Testing of NonSmall-Cell Lung Cancer Shows \r\nHigh Concordance after Harmonization of Techniques and \r\nInterpretation Criteria. J Thorac Oncol 2014;9:168592.\r\n5. Thorne-Nuzzo T., Williams C., Catallini A., et al. A Sensitive \r\nALK Immunohistochemistry Companion Diagnostic Test Identifies \r\nPatients Eligible for Treatment with Crizotinib. J Thorac Oncol \r\n2017;12:804-13."
                    }
