                        "text": "\r\nThis result has been reviewed and approved by Deepika Sirohi, M.D. \r\nControls performed as expected.\r\nINTERPRETIVE INFORMATION: ROS1 by IHC Result\r\n\r\nTest Information:\r\n\r\nAn absence of cytoplasmic or membranous staining is defined as \r\nnegative for ROS1 by Immunohistochemistry. Positive staining \r\ndemonstrates strong and diffuse, both membranous and cytoplasmic \r\nstaining and may predict patient response to tyrosine kinase \r\ninhibitor therapy. An equivocal result is defined by any degree of \r\ncytoplasmic staining only or by weak and/or focal membranous and \r\ncytoplasmic staining. Equivocal and positive results by \r\nimmunohistochemistry will be confirmed by fluorescent in-situ \r\nhybridization (FISH).\r\n\r\nControls were run and performed as expected.\r\n\r\nThis assay is performed on formalin fixed paraffin embedded \r\ntissue, using the ROS1 D4D6 clone and a proprietary multimer based \r\ndetection system.\r\n\r\nThis test was developed and its performance characteristics \r\ndetermined by ARUP Laboratories. It has not been cleared or \r\napproved by the US Food and Drug Administration. This test was \r\nperformed in a CLIA certified laboratory and is intended for \r\nclinical purposes.\r\n\r\nReferences\r\n1. Lindeman NI., Cagle PT., Aisner DL., et al. Updated Molecular \r\nTesting Guideline for the Selection of Lung Cancer Patients for \r\nTreatment With Targeted Tyrosine Kinase Inhibitors. Guideline From \r\nthe College of American Pathologists, the International \r\nAssociation for the Study of Lung Cancer, and the Association for \r\nMolecular Pathology. J Mol Diagn 2018;20:129-59.\r\n2. Yoshida A., Tsuda K., Wakai S., et al. Immunohistochemical \r\ndetection of ROS1 is useful for identifying ROS1 rearrangements in \r\nlung cancers. Mod Pathol 2014;27:71120.\r\n3. Selinger CI., Li BT., Pavlakis N., et al.  Screening for ROS1 \r\ngene rearrangements in non-small cell lung cancers using \r\nimmunohistochemistry with FISH confirmation is an effective method \r\nto identify this rare target. Histopathol 2017;70:40211.\r\n4. Yang J., Pyo J-S., Kang G. Clinicopathological significance and \r\ndiagnostic approach of ROS1 rearrangement in non-small cell lung \r\ncancer: a meta-analysis: ROS1 in non-small cell lung cancer. Int J \r\nBiol Markers 2018;33:5207.\r\n5. Rogers T-M., Russel PA., Wright G., et al. Comparison of \r\nMethods in the Detection of ALK and ROS1 Rearrangements in Lung \r\nCancer. J Thorac Oncol 2015;10:6118."
